          <option value="valor3">Opción 3</option>
       </select>

        <button className="botonEditarBuscarEquipoTrabajo"> Editar Equipo </button>
        <button  className='buttonVolverBuscarEquipoTrabajo'> Volver </button>

    </div>
    )

}


